import { TextField } from "@mui/material"
import { useTzValidate } from "../MyHooks/UseTzValidate"
import { usePhoneValidate } from "../MyHooks/UsePhoneValidate"
import { usePsswordValidate } from "../MyHooks/UsePasswordValidate"
import { useValidate } from "../MyHooks/UseValidate"
import { useDispatch, useSelector } from "react-redux"
import { addUser, setCurrentUser } from "../redux/Actions"
import { useNavigate } from "react-router"
import { InputWithValidate } from "./inputs/InputWithValidate"

export const Register = () => {


    let users = useSelector(x => x.Users)

    let dis = useDispatch()

    let nav = useNavigate()

    /*
    let tzVal = useTzValidate()

    let phoneVal = usePhoneValidate()

    let passwordVal = usePsswordValidate()

    

    let creditNumberVal = useValidate(
        [{ func: (value) => !/^\d{16}$/.test(value), messege: "invalid credit number" }]

    )



    let validitiVal = useValidate(
        [{ func: (value) => !/^((0[1-9])|(1[0-2]))-\d{2}$/.test(value), messege: "invalid validiti" }]
    )

    let cvvVal = useValidate(
        [{ func: (value) => !/^\d{3}$/.test(value), messege: "invalid cvv" }]
    )

    */


    let creditNumberCondition = [{ func: (value) => !/^\d{16}$/.test(value), messege: "invalid credit number" }]

    let validitiCondition = [{ func: (value) => !/^((0[1-9])|(1[0-2]))-\d{2}$/.test(value), messege: "invalid validiti" }]

    let cvvCondition = [{ func: (value) => !/^\d{3}$/.test(value), messege: "invalid cvv" }]

    const login = (e) => {
        e.preventDefault()

        for (let i = 0; i < e.target.length - 2; i += 2)
            if (document.getElementById(e.target[i].id + "-helper-text")) {
                console.log(document.getElementById(e.target[i].id + "-helper-text"));

                return
            }

        for (let i = 0; i < users.length; i++)
            if (users[i].tz == e.target[0].value) {
                tzVal.setTzError("identity number exists")
                tzVal.setTzErrorDisplay(true)
                return
            }

        let user = {
            id: (users.length + 1) * 100,
            name: e.target[2].value,
            tz: e.target[0].value,
            phone: e.target[6].value,
            password: e.target[4].value,
            CreditNumber: e.target[8].value,
            validity: e.target[10].value,
            cvv: e.target[12].value,
            userTypeId: 2
        }

        dis(addUser(user))
        dis(setCurrentUser(user))
        nav("/UserZone")

    }

    return <>
        <form onSubmit={(e) => login(e)}>
            {/*
            <TextField className="inputTextField" id="tzInput" label="identity" variant="outlined" error={tzVal.tzErrorDisplay} onBlur={(e) => tzVal.checkTz(e)} helperText={tzVal.tzError} required />
            <TextField className="inputTextField" id="nameInput" label="user name" variant="outlined"></TextField>
            <TextField className="inputTextField" id="passwordInput" type="password" label="password" variant="outlined" error={passwordVal.passwordErrorDisplay} helperText={passwordVal.passwordError} required />
            <TextField className="inputTextField" id="phoneInput" type="tel" label="phone" variant="outlined" error={phoneVal.phoneErrorDisplay} onBlur={(e) => phoneVal.checkPhone(e)} helperText={phoneVal.phoneError} />
            <TextField className="inputTextField" id="creditNumberInput" label="credit number" variant="outlined" error={creditNumberVal.errorDisplay} onBlur={(e) => creditNumberVal.check(e)} helperText={creditNumberVal.error} required></TextField>
            <TextField className="inputTextField" id="validityInput" label="validity" variant="outlined" error={validitiVal.errorDisplay} onBlur={(e) => validitiVal.check(e)} helperText={validitiVal.error} required></TextField>
            <TextField className="inputTextField" id="cvvInput" type="password" label="cvv" variant="outlined" error={cvvVal.errorDisplay} onBlur={(e) => cvvVal.check(e)} helperText={cvvVal.error} required></TextField>
            */}
            <InputIdentity className="inputTextField" id="tzInput" label="identity" errorMessege={identityErrorMessege}></InputIdentity>
            <TextField className="inputTextField" id="nameInput" label="user name"></TextField>
            <InputPassword className="inputTextField" id="passwordInput" type="password" label="password" errorMessege={passwordErrorMessege}></InputPassword>
            <InputPhone className="inputTextField" id="phoneInput" type="tel" label="phone" errorMessege={phoneErrorMessege}></InputPhone>
            <InputWithValidate className="inputTextField" id="creditNumberInput" label="credit number" error={creditNumberVal.errorDisplay} onBlur={(e) => creditNumberVal.check(e)} helperText={creditNumberVal.error} required={true}></InputWithValidate>
            <InputWithValidate className="inputTextField" id="validityInput" label="validity" error={validitiVal.errorDisplay} onBlur={(e) => validitiVal.check(e)} helperText={validitiVal.error} required={true}></InputWithValidate>
            <InputWithValidate className="inputTextField" id="cvvInput" type="password" label="cvv" error={cvvVal.errorDisplay} onBlur={(e) => cvvVal.check(e)} helperText={cvvVal.error} required={true}></InputWithValidate>




            <TextField className="inputTextField" id="submitInput" type="submit" variant="outlined" value={"register"} />
        </form>
    </>
}
